/*WI_MT_DRVD_NRT_POS_TRX_RETRO_BGM POPULATE*/ CREATE VOLATILE TABLE WI_DRVD_NRT_TSS_RETRO_BGM AS ( SELECT ALLOCATED_POS_ADJ_KEY, PROCESS_DATE, BGM_PERC FROM ( SELECT ALLOCATED_POS_ADJ_KEY, BOOKINGS_PROCESS_DT AS PROCESS_DATE, COALESCE(SUM(DV_BKG_GROSS_MGN_AMOUNT*100)/ NULLIFZERO (SUM(DV_BKG_REBATE_AMT)) ,0)AS BGM_PERC FROM $$STGDB.WI_MT_DRVD_NRT_POS_TRX_RETRO_BGM GROUP BY 1,2 )BGM WHERE (BGM_PERC >98 OR BGM_PERC <=0) ) WITH DATA PRIMARY INDEX(ALLOCATED_POS_ADJ_KEY) ON COMMIT PRESERVE ROWS;
DELETE FROM $$STGDB.WI_DRVD_NRT_POS_RETRO_TSS_BGM;
INSERT INTO $$STGDB.WI_DRVD_NRT_POS_RETRO_TSS_BGM ( ALLOCATED_POS_ADJ_KEY, BK_POS_TRANSACTION_ID_INT, DV_FISCAL_YEAR_MTH_NUMBER_INT, BOOKINGS_PROCESS_DT, DSV_OR_POS_TYPE_CD, TSS_COUNTRY_FACTOR_KEY, DV_BKG_GROSS_MGN_AMOUNT, DV_BGM_FX_COST_AMOUNT, DV_FX_NET_PRICE_AMT, DV_BKG_REBATE_AMT, DV_FX_REBATE_PRICE_AMT ) SELECT POS_TRX.ALLOCATED_POS_ADJ_KEY ,POS_TRX.BK_POS_TRANSACTION_ID_INT ,POS_TRX.DV_FISCAL_YEAR_MTH_NUMBER_INT ,POS_TRX.BOOKINGS_PROCESS_DT ,POS_TRX.DSV_OR_POS_TYPE_CD , CASE WHEN POS_TRX.SERVICE_FLG = 'Y' AND POS_TRX.DD_COMP_US_NET_PRICE_AMT <> 0 THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN TSS.TSS_COUNTRY_FACTOR_KEY WHEN COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT) IS NOT NULL THEN COALESCE(L4_TSD.TSS_COUNTRY_FACTOR_KEY,L3_TSD.TSS_COUNTRY_FACTOR_KEY,L2_TSD.TSS_COUNTRY_FACTOR_KEY,L1_TSD.TSS_COUNTRY_FACTOR_KEY,-999) ELSE -999 END ELSE -999 END TSS_COUNTRY_FACTOR_KEY
,CASE WHEN POS_TRX.SERVICE_FLG = 'Y' AND POS_TRX.DD_COMP_US_NET_PRICE_AMT <> 0 THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN CAST( (POS_TRX.DD_COMP_US_NET_PRICE_AMT - (TSS.COST_FACTOR_PCT * POS_TRX.DD_COMP_US_LIST_PRICE_AMT /100) ) AS DECIMAL(18,6) ) WHEN COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT) IS NOT NULL THEN CAST( (POS_TRX.DD_COMP_US_NET_PRICE_AMT * (COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT)/100) ) AS DECIMAL(18,6) ) ELSE 0 END ELSE 0 END DV_BKG_GROSS_MGN_AMOUNT ,
CASE WHEN POS_TRX.SERVICE_FLG = 'Y' AND POS_TRX.DD_COMP_US_NET_PRICE_AMT <> 0 AND MCR.SALES_TERRITORY_KEY IS NOT NULL THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN CAST( ( (TSS.COST_FACTOR_PCT*POS_TRX.DD_COMP_US_LIST_PRICE_AMT /100) ) AS DECIMAL(18,6) ) WHEN COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT) IS NOT NULL THEN CAST( COALESCE((COALESCE(MCR.ANNUAL_BUDGET_CONV_RT,0)/NULLIF(MCR.PL_CONVERSION_RT,0))*POS_TRX.DD_COMP_US_NET_PRICE_AMT,0) * (COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT))/100 AS DECIMAL(18,6) ) ELSE 0 END ELSE 0 END DV_BGM_FX_COST_AMOUNT
, CASE WHEN (POS_TRX.SERVICE_FLG = 'Y' AND POS_TRX.DD_COMP_US_NET_PRICE_AMT <> 0 AND COALESCE(TSS.TSS_COUNTRY_FACTOR_KEY,L4_TSD.TSS_COUNTRY_FACTOR_KEY,L3_TSD.TSS_COUNTRY_FACTOR_KEY,L2_TSD.TSS_COUNTRY_FACTOR_KEY,L1_TSD.TSS_COUNTRY_FACTOR_KEY) IS NOT NULL ) THEN COALESCE((COALESCE(MCR.ANNUAL_BUDGET_CONV_RT,0)/NULLIF(MCR.PL_CONVERSION_RT,0))*POS_TRX.DD_COMP_US_NET_PRICE_AMT,0) ELSE 0 END AS DV_FX_NET_PRICE_AMT , /*REBATE BGM NET START */ CASE WHEN POS_TRX.SERVICE_FLG = 'Y' AND POS_TRX.DD_COMP_US_NET_PRICE_AMT <> 0 THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN CAST( (POS_TRX.DD_COMP_US_NET_PRICE_AMT - (TSS.REBATE_FACTOR_PCT * POS_TRX.DD_COMP_US_NET_PRICE_AMT /100) ) AS DECIMAL(18,6) ) WHEN COALESCE(L4_TSD.REBATE_FACTOR_PCT,L3_TSD.REBATE_FACTOR_PCT,L2_TSD.REBATE_FACTOR_PCT,L1_TSD.REBATE_FACTOR_PCT,0) <> 0 THEN CAST( (POS_TRX.DD_COMP_US_NET_PRICE_AMT * (COALESCE(L4_TSD.REBATE_FACTOR_PCT,L3_TSD.REBATE_FACTOR_PCT,L2_TSD.REBATE_FACTOR_PCT,L1_TSD.REBATE_FACTOR_PCT)/100) ) AS DECIMAL(18,6) ) ELSE POS_TRX.DD_COMP_US_NET_PRICE_AMT END ELSE 0 END DV_BKG_REBATE,
CASE WHEN (POS_TRX.SERVICE_FLG = 'Y' AND DV_BKG_REBATE <> 0 AND COALESCE(TSS.TSS_COUNTRY_FACTOR_KEY,L4_TSD.TSS_COUNTRY_FACTOR_KEY,L3_TSD.TSS_COUNTRY_FACTOR_KEY,L2_TSD.TSS_COUNTRY_FACTOR_KEY,L1_TSD.TSS_COUNTRY_FACTOR_KEY) IS NOT NULL ) THEN COALESCE((COALESCE(MCR.ANNUAL_BUDGET_CONV_RT,0)/NULLIF(MCR.PL_CONVERSION_RT,0))*DV_BKG_REBATE,0) ELSE 0 END AS DV_FX_REBATE_PRICE_AMT /*REBATE BGM NET END */ FROM $$SLSORDVWDB.MT_DRVD_NRT_POS_TRX POS_TRX INNER JOIN $$STGDB.WI_MT_DRVD_NRT_POS_TRX_RETRO WI ON POS_TRX.ALLOCATED_POS_ADJ_KEY=WI.ALLOCATED_POS_ADJ_KEY AND POS_TRX.SERVICE_FLG = 'Y' AND POS_TRX.ALLOCATED_POS_ADJ_KEY IN(SELECT ALLOCATED_POS_ADJ_KEY FROM WI_DRVD_NRT_TSS_RETRO_BGM) INNER JOIN ( SELECT FISCAL_YEAR_MONTH_INT FROM $$COMREFVWDB.R_FISCAL_DAY_TO_YEAR WHERE CURRENT_FISCAL_QTR_FLAG = 'Y' UNION SELECT FISCAL_YEAR_MONTH_INT FROM $$COMREFVWDB.R_FISCAL_DAY_TO_YEAR WHERE PREVIOUS_FISCAL_QTR_FLAG = 'Y' AND 1 =( SELECT COUNT(*) FROM $$COMREFVWDB.R_FISCAL_QUARTER_TO_YEAR WHERE DATE= FISCAL_QUARTER_START_DATE AND CURRENT_FISCAL_QTR_FLAG ='Y') ) FISC_MTH ON FISC_MTH.FISCAL_YEAR_MONTH_INT = POS_TRX.DV_FISCAL_YEAR_MTH_NUMBER_INT
LEFT JOIN $$COMREFVWDB.MT_ENDCUST_CUSTOMER_PARTY_HIER ENDCUST ON WI.END_CUSTOMER_KEY=ENDCUST.END_CUSTOMER_KEY
LEFT JOIN $$COMREFVWDB.R_SALES_HIERARCHY HIER ON POS_TRX.SALES_TERRITORY_KEY=HIER.SALES_TERRITORY_KEY
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR TSS ON TSS.PRODUCT_KEY = POS_TRX.PRODUCT_KEY AND TSS.BK_ISO_COUNTRY_CD = ENDCUST.BRANCH_ISO_COUNTRY_CD --AND TSS.SALES_TERRITORY_NAME=HIER.L1_SALES_TERRITORY_NAME_CODE AND TSS.SALES_TERRITORY_NAME=COALESCE(HIER.L2_SALES_TERRITORY_NAME_CODE,HIER.L1_SALES_TERRITORY_NAME_CODE) AND TSS.BKGS_MEASURE_TRANS_TYPE_CODE = 'POS' AND TSS.COUNTRY_FLG='X'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L4_TSD ON L4_TSD.SALES_TERRITORY_NAME=HIER.L4_SALES_TERRITORY_NAME_CODE AND L4_TSD.COUNTRY_FLG='N'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L3_TSD ON L3_TSD.SALES_TERRITORY_NAME=HIER.L3_SALES_TERRITORY_NAME_CODE AND L3_TSD.COUNTRY_FLG='N'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L2_TSD ON L2_TSD.SALES_TERRITORY_NAME=HIER.L2_SALES_TERRITORY_NAME_CODE AND L2_TSD.COUNTRY_FLG='N'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L1_TSD ON L1_TSD.SALES_TERRITORY_NAME=HIER.L1_SALES_TERRITORY_NAME_CODE AND L1_TSD.COUNTRY_FLG='N'
LEFT OUTER JOIN ( SELECT CR.PL_CONVERSION_RT,CR.ANNUAL_BUDGET_CONV_RT,CR.FISCAL_YEAR_MONTH_NUM_INT,FX.SALES_TERRITORY_KEY FROM $$FINLGLVWDB.MT_MONTHLY_CONVERSION_RATE CR, $$SLSORDVWDB.MT_PROFITABILITY_FX_NORM FX, (SELECT (PDATE.FISCAL_YEAR_NUMBER_INT-5)*100+PDATE.FISCAL_MONTH_NUMBER_INT AS START_DATE, CASE WHEN PDATE.FISCAL_MONTH_NUMBER_INT = 12 THEN (PDATE.FISCAL_YEAR_NUMBER_INT+1)*100+1 ELSE PDATE.FISCAL_YEAR_MTH_NUMBER_INT+1 END AS END_DATE FROM $$ETLVWDB.BKG_PROCESS_DT_CNTRL PDATE )PDATE WHERE CR.BK_FROM_CURRENCY_CD=FX.BK_CURRENCY_CD AND CR.FISCAL_YEAR_MONTH_NUM_INT BETWEEN PDATE.START_DATE AND PDATE.END_DATE AND CR.BK_TO_CURRENCY_CD='USD' )MCR ON POS_TRX.SALES_TERRITORY_KEY=MCR.SALES_TERRITORY_KEY AND POS_TRX.DV_FISCAL_YEAR_MTH_NUMBER_INT=MCR.FISCAL_YEAR_MONTH_NUM_INT WHERE POS_TRX.END_CUSTOMER_KEY = WI.END_CUSTOMER_KEY ;
COLLECT STATS ON $$STGDB.WI_MT_DRVD_NRT_POS_TRX_RETRO_BGM;
UPDATE MT FROM $$STGDB.WI_MT_DRVD_NRT_POS_TRX_RETRO_BGM MT, $$STGDB.WI_DRVD_NRT_POS_RETRO_TSS_BGM WI SET TSS_COUNTRY_FACTOR_KEY=WI.TSS_COUNTRY_FACTOR_KEY, DV_BKG_GROSS_MGN_AMOUNT=WI.DV_BKG_GROSS_MGN_AMOUNT, DV_BGM_FX_COST_AMOUNT=WI.DV_BGM_FX_COST_AMOUNT, DV_FX_NET_PRICE_AMT=WI.DV_FX_NET_PRICE_AMT, DV_BKG_REBATE_AMT = WI.DV_BKG_REBATE_AMT, DV_FX_REBATE_PRICE_AMT = WI.DV_FX_REBATE_PRICE_AMT WHERE MT.BK_POS_TRANSACTION_ID_INT = WI.BK_POS_TRANSACTION_ID_INT AND MT.ALLOCATED_POS_ADJ_KEY=WI.ALLOCATED_POS_ADJ_KEY AND MT.DSV_OR_POS_TYPE_CD = 'POS';
/* WI_DRVD_NRT_POS_TRX POPULTAE */ CREATE VOLATILE TABLE WI_DRVD_NRT_TSS_BGM AS ( SELECT ALLOCATED_POS_ADJ_KEY, PROCESS_DATE, BGM_PERC FROM ( SELECT ALLOCATED_POS_ADJ_KEY, BOOKINGS_PROCESS_DT AS PROCESS_DATE, COALESCE(SUM(DV_BKG_GROSS_MGN_AMOUNT*100)/ NULLIFZERO (SUM(DV_BKG_REBATE_AMT)) ,0)AS BGM_PERC FROM $$STGDB.WI_DRVD_NRT_POS_TRX WHERE SERVICE_FLG='Y' GROUP BY 1,2 )BGM WHERE (BGM_PERC >98 OR BGM_PERC <=0) ) WITH DATA PRIMARY INDEX(ALLOCATED_POS_ADJ_KEY) ON COMMIT PRESERVE ROWS;
UPDATE NRT FROM $$STGDB.WI_DRVD_NRT_POS_TRX NRT SET TSS_COUNTRY_FACTOR_KEY = -888, DV_BKG_GROSS_MGN_AMOUNT= 0, DV_BGM_FX_COST_AMOUNT= 0, DV_FX_NET_PRICE_AMT=0, DV_BKG_REBATE_AMT=0, DV_FX_REBATE_PRICE_AMT=0 WHERE 1=1 AND NRT.SERVICE_FLG = 'Y' AND NRT.DD_COMP_US_NET_PRICE_AMT <> 0 AND NRT.ALLOCATED_POS_ADJ_KEY IN (SELECT ALLOCATED_POS_ADJ_KEY FROM WI_DRVD_NRT_TSS_BGM);
UPDATE NRT FROM $$STGDB.WI_DRVD_NRT_POS_TRX NRT , (SELECT NRT.ALLOCATED_POS_ADJ_KEY, NRT.DV_FISCAL_YEAR_MTH_NUMBER_INT,
CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN TSS.TSS_COUNTRY_FACTOR_KEY WHEN COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT) IS NOT NULL THEN COALESCE(L4_TSD.TSS_COUNTRY_FACTOR_KEY,L3_TSD.TSS_COUNTRY_FACTOR_KEY,L2_TSD.TSS_COUNTRY_FACTOR_KEY,L1_TSD.TSS_COUNTRY_FACTOR_KEY,-999) ELSE -999 END TSS_COUNTRY_FACTOR_KEY,
CASE WHEN SERVICE_FLG = 'Y' AND DD_COMP_US_NET_PRICE_AMT <> 0 THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN CAST( (NRT.DD_COMP_US_NET_PRICE_AMT - (TSS.COST_FACTOR_PCT * NRT.DD_COMP_US_LIST_PRICE_AMT /100) ) AS DECIMAL(18,6) ) WHEN COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT) IS NOT NULL THEN CAST( (NRT.DD_COMP_US_NET_PRICE_AMT * (COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT)/100) ) AS DECIMAL(18,6) ) ELSE 0 END ELSE 0 END DV_BKG_GROSS_MGN_AMOUNT,
CASE WHEN SERVICE_FLG = 'Y' AND DD_COMP_US_NET_PRICE_AMT <> 0 AND MCR.SALES_TERRITORY_KEY IS NOT NULL THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN CAST( ( (TSS.COST_FACTOR_PCT*NRT.DD_COMP_US_LIST_PRICE_AMT /100) ) AS DECIMAL(18,6) ) WHEN COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT) IS NOT NULL THEN CAST( COALESCE((COALESCE(MCR.ANNUAL_BUDGET_CONV_RT,0)/NULLIF(MCR.PL_CONVERSION_RT,0))*NRT.DD_COMP_US_NET_PRICE_AMT,0) * (COALESCE(L4_TSD.COST_FACTOR_PCT,L3_TSD.COST_FACTOR_PCT,L2_TSD.COST_FACTOR_PCT,L1_TSD.COST_FACTOR_PCT))/100 AS DECIMAL(18,6) ) ELSE 0 END ELSE 0 END DV_BGM_FX_COST_AMOUNT,
CASE WHEN (NRT.SERVICE_FLG = 'Y' AND NRT.DD_COMP_US_NET_PRICE_AMT <> 0 AND COALESCE(TSS.TSS_COUNTRY_FACTOR_KEY,L4_TSD.TSS_COUNTRY_FACTOR_KEY,L3_TSD.TSS_COUNTRY_FACTOR_KEY,L2_TSD.TSS_COUNTRY_FACTOR_KEY,L1_TSD.TSS_COUNTRY_FACTOR_KEY) IS NOT NULL ) THEN COALESCE((COALESCE(MCR.ANNUAL_BUDGET_CONV_RT,0)/NULLIF(MCR.PL_CONVERSION_RT,0))*NRT.DD_COMP_US_NET_PRICE_AMT,0) ELSE 0 END AS DV_FX_NET_PRICE_AMT,
/*REBATE BGM NET START */ CASE WHEN NRT.SERVICE_FLG = 'Y' AND NRT.DD_COMP_US_NET_PRICE_AMT <> 0 THEN CASE WHEN TSS.TSS_COUNTRY_FACTOR_KEY IS NOT NULL THEN CAST( (NRT.DD_COMP_US_NET_PRICE_AMT - (TSS.REBATE_FACTOR_PCT * NRT.DD_COMP_US_NET_PRICE_AMT /100) ) AS DECIMAL(18,6) ) WHEN COALESCE(L4_TSD.REBATE_FACTOR_PCT,L3_TSD.REBATE_FACTOR_PCT,L2_TSD.REBATE_FACTOR_PCT,L1_TSD.REBATE_FACTOR_PCT,0) <> 0 THEN CAST( (NRT.DD_COMP_US_NET_PRICE_AMT * (COALESCE(L4_TSD.REBATE_FACTOR_PCT,L3_TSD.REBATE_FACTOR_PCT,L2_TSD.REBATE_FACTOR_PCT,L1_TSD.REBATE_FACTOR_PCT)/100) ) AS DECIMAL(18,6) ) ELSE NRT.DD_COMP_US_NET_PRICE_AMT END ELSE 0 END DV_BKG_REBATE,
CASE WHEN (NRT.SERVICE_FLG = 'Y' AND DV_BKG_REBATE <> 0 AND COALESCE(TSS.TSS_COUNTRY_FACTOR_KEY,L4_TSD.TSS_COUNTRY_FACTOR_KEY,L3_TSD.TSS_COUNTRY_FACTOR_KEY,L2_TSD.TSS_COUNTRY_FACTOR_KEY,L1_TSD.TSS_COUNTRY_FACTOR_KEY) IS NOT NULL ) THEN COALESCE((COALESCE(MCR.ANNUAL_BUDGET_CONV_RT,0)/NULLIF(MCR.PL_CONVERSION_RT,0))*DV_BKG_REBATE,0) ELSE 0 END AS DV_FX_REBATE_PRICE_AMT /*REBATE BGM NET END */
FROM $$STGDB.WI_DRVD_NRT_POS_TRX NRT
LEFT JOIN $$COMREFVWDB.MT_ENDCUST_CUSTOMER_PARTY_HIER ENDCUST ON NRT.END_CUSTOMER_KEY=ENDCUST.END_CUSTOMER_KEY
LEFT JOIN $$COMREFVWDB.R_SALES_HIERARCHY HIER ON NRT.SALES_TERRITORY_KEY=HIER.SALES_TERRITORY_KEY
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR TSS ON TSS.PRODUCT_KEY = NRT.PRODUCT_KEY AND TSS.BK_ISO_COUNTRY_CD = ENDCUST.BRANCH_ISO_COUNTRY_CD --AND TSS.SALES_TERRITORY_NAME=HIER.L1_SALES_TERRITORY_NAME_CODE AND TSS.SALES_TERRITORY_NAME=COALESCE(HIER.L2_SALES_TERRITORY_NAME_CODE,HIER.L1_SALES_TERRITORY_NAME_CODE) AND TSS.BKGS_MEASURE_TRANS_TYPE_CODE = 'POS' AND TSS.COUNTRY_FLG='X'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L4_TSD ON L4_TSD.SALES_TERRITORY_NAME=HIER.L4_SALES_TERRITORY_NAME_CODE AND L4_TSD.COUNTRY_FLG='N'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L3_TSD ON L3_TSD.SALES_TERRITORY_NAME=HIER.L3_SALES_TERRITORY_NAME_CODE AND L3_TSD.COUNTRY_FLG='N'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L2_TSD ON L2_TSD.SALES_TERRITORY_NAME=HIER.L2_SALES_TERRITORY_NAME_CODE AND L2_TSD.COUNTRY_FLG='N'
LEFT JOIN $$SLSORDVWDB.N_TSS_PRODUCT_COST_FACTOR L1_TSD ON L1_TSD.SALES_TERRITORY_NAME=HIER.L1_SALES_TERRITORY_NAME_CODE AND L1_TSD.COUNTRY_FLG='N'
LEFT OUTER JOIN ( SELECT CR.PL_CONVERSION_RT,CR.ANNUAL_BUDGET_CONV_RT,CR.FISCAL_YEAR_MONTH_NUM_INT,FX.SALES_TERRITORY_KEY FROM $$FINLGLVWDB.MT_MONTHLY_CONVERSION_RATE CR, $$SLSORDVWDB.MT_PROFITABILITY_FX_NORM FX, (SELECT (PDATE.FISCAL_YEAR_NUMBER_INT-5)*100+PDATE.FISCAL_MONTH_NUMBER_INT AS START_DATE, PDATE.FISCAL_YEAR_MTH_NUMBER_INT+1 AS END_DATE FROM $$ETLVWDB.MBR_PROCESS_DATE PDATE )PDATE WHERE CR.BK_FROM_CURRENCY_CD=FX.BK_CURRENCY_CD AND CR.BK_TO_CURRENCY_CD='USD' AND CR.FISCAL_YEAR_MONTH_NUM_INT BETWEEN PDATE.START_DATE AND PDATE.END_DATE )MCR ON NRT.SALES_TERRITORY_KEY=MCR.SALES_TERRITORY_KEY AND NRT.DV_FISCAL_YEAR_MTH_NUMBER_INT=MCR.FISCAL_YEAR_MONTH_NUM_INT
WHERE 1=1 AND SERVICE_FLG = 'Y' AND DD_COMP_US_NET_PRICE_AMT <> 0 ) HIST SET TSS_COUNTRY_FACTOR_KEY =HIST.TSS_COUNTRY_FACTOR_KEY , DV_BKG_GROSS_MGN_AMOUNT = HIST.DV_BKG_GROSS_MGN_AMOUNT , DV_BGM_FX_COST_AMOUNT =HIST.DV_BGM_FX_COST_AMOUNT , DV_FX_NET_PRICE_AMT =HIST.DV_FX_NET_PRICE_AMT ,DV_BKG_REBATE_AMT= HIST.DV_BKG_REBATE ,DV_FX_REBATE_PRICE_AMT= HIST.DV_FX_REBATE_PRICE_AMT WHERE NRT.ALLOCATED_POS_ADJ_KEY =HIST.ALLOCATED_POS_ADJ_KEY AND SERVICE_FLG='Y' AND NRT.TSS_COUNTRY_FACTOR_KEY=-888;
COLLECT STATS ON $$STGDB.WI_MT_DRVD_NRT_POS_TRX_RETRO_BGM;
